import React, { Component } from 'react'

class MemeGenerator extends Component {
    constructor() {
        super()
        this.state = {
            topText: "",
            bottomText: "",
            randomImg: "http://i.imgflip.com/1bij.jpg"
        }
    }

    render() {
        return (
            <h1>{this.state.data}</h1>
        )
    }
}

export default MemeGenerator
